import React from "react";

const CartItem = ({item:{name, imageUrl, quantity, price}}) => (
    <div className="cart-item">
        <img src={imageUrl}/>
        <span className="item-details">
            <div className="name">{name}</div>
            <div>{quantity}*{price}</div>
        </span>
    </div>
)

export default CartItem;
